(145, 'Thunder From Down Under', ' <strong> Thunder From Down Under</strong> <br><p><strong>Presented by: Jones Entertainment Group<br> Centrepointe Theatre<br>   Thursday,  March 30, 2017 at 7:00 p.m.<br></strong><p><strong>ON SALE FRIDAY OCTOBER 21 at 10 AM<br><br>AUSTRALIA’S THUNDER FROM DOWN UNDER </strong><br><br>The PERFECT Girl&#39;s Night Outback! Australia&#39;s HOTTEST Export – <em>Thunder From Down Under </em>- hits an intimate Vegas stage every night of the week showing off chiseled bodies, seductive dance routines, cheeky humor and boy-next-door charm that you won&#39;t be able to resist!<br><br>Each sexy performer embodies a different female fantasy and brings it to life, turning your wildest dreams into reality. This isn&#39;t the type of show you just sit and watch - Thunder is a fully interactive experience. The blokes dance on tabletops, make their way through the crowd and even select a few lucky ladies to join in the fun on stage. Don&#39;t miss your chance to get up close and personal with these Aussie hunks! Critics, celebrities and fans from around the world rave that <em>Thunder From Down Under</em> is the is best male revue show on the Strip! <br><br>This show is the ultimate bachelorette party, divorce party and girls&#39; night out destination.<br><br><em>For mature audiences.<br>Please be advised strobe lights and haze effects are used during the performance of Thunder from Down Under. <br><br><br></em><p><strong>Genre: </strong>Variety, Dance<br><strong>Language: </strong>English<br><strong>Tickets: </strong>$57.60 - $72.45 <br><a></a><p><a href="http://ev7.evenue.net/cgi-bin/ncommerce3/SEGetEventInfo?ticketCode=GS%3ACP%3AC1617%3ACT0330C%3A&linkID=centrepointe&shopperContext=&pc=&caller=&appCode=&groupCode=VCPT&cgc=" rel="nofollow">March 30 at 7:00 pm</a><br></p></p></p></p>', 'http://ottawa.eventful.com/events/thunder-down-under-/E0-001-061150446-0?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 59);
