(146, 'Christmas in Nashville', ' <strong> Christmas in Nashville</strong> <br><p><strong>Presented by: Curtain Call Entertainment & Showbizz Productions<br> Centrepointe Theatre<br>   Saturday,  November 12, 2016 at 7:30 p.m.<br></strong><p><strong>Christmas In Nashville </strong>is a Christmas tribute to the early days of the Grand Ole Opry in Nashville, TN. <br><br>On Saturday, November 12, 2016, for one day only, the Centrepointe Theatres Mainstage becomes the <em>Ryman Auditorium</em>... <br><br>Come and join us for a wonderful evening with <em>Minnie Pearl</em>, <em>Johnny Cash & June Carter-Cash</em>, <em>Hank Williams Sr</em>, <em>Patsy Cline</em>, <em>Garth Brooks</em>, <em>Dolly Parton</em>, <em>Alan Jackson</em>, <em>Loretta Lynn</em>, Country comedienne <em>Bobby-Jo</em>, Country comediqnne & host, <em><strong>Jethro Hicks </strong></em>and more.&quot;<br><p><strong>Genre: </strong>Music, Musical/Theatre<br><strong>Language: </strong>English<br><strong>Tickets: </strong> $61.25 | Seniors (65+) $55.25 <br><a></a><p><a href="http://ev7.evenue.net/cgi-bin/ncommerce3/SEGetEventInfo?ticketCode=GS%3ACP%3AC1617%3ACT1112C%3A&linkID=centrepointe&shopperContext=&pc=&caller=&appCode=&groupCode=CMDY&cgc=" rel="nofollow">November 12 at 7:30 pm</a><br></p></p></p></p>', 'http://ottawa.eventful.com/events/christmas-nashville-/E0-001-072513518-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
