(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(149, 'kick ITa dance club for kids', ' <strong> kick ITa dance club for kids</strong> <br><p><strong>Presented by: Centrepointe Theatres<br> Centrepointe Studio Theatre<br>   Saturday,  March 04, 2017 at 2:00 p.m.<br></strong><p><p><a href="https://edit.centrepointetheatre.ca/cs/resources/wcm/3rdparty/fckeditor/editor/%5B!--$wcmUrl(&#39;nodelink&#39;,&#39;18413&#39;)--%5D" rel="nofollow"><b>Saturday, October 15, 2016 at 2:00 p.m.</b></a><p><a href="http://www.centrepointetheatre.com/en/events_tickets/March2017/kick_IT/index.htm" rel="nofollow"><strong>Saturday, April 29, 2017 at 2:00 p.m.</strong></a><p> <p> <p>Kids love to dance and Centrepointe Theatres delivers with three kick IT events this season! Once again we host our sell-out dance club that has kids movin’ and groovin’ no matter the weather. For only $5 each, tickets sell out fast!<p> <p>Mark your calendars for all three dates this season, when the Centrepointe Studio Theatre undergoes a major makeover. Four- to ten-year-olds can let loose on the dance floor in the coolest joint in town! Need new moves? Learn the slickest steps from our enthusiastic in-house dance crew, <a href="http://www.flavafactory.ca/" rel="nofollow">The Flava Factory</a>, Ottawa’s only street dance crew. <p> <p>Kids love the bangin’ beats of <a href="http://dynamixpro.ca/" rel="nofollow"><strong>Dynamix Productions</strong></a>. When they need a breather, they can get creative in the <a href="http://www.dynamixpro.ca/photobooth/" rel="nofollow"><strong>Dynamix Photobooth</strong></a> – and take home a complimentary pic as a souvenir.<p> <p>For the chaperones, there’s always the Big Kids Coffee Bar stocked with snacks to nibble on. Better yet, join your youngsters on the dance floor and show ‘em what you’ve got!<p> <p><strong>Tickets are available only at the Centrepointe Theatres Box Office or by calling 613-580-2700.<br><br>Please note all children must be accompanied by an adult. Both adults and children require tickets for admittance. If you have any questions, please contact our box office at </strong><a href="mailto:ctboxoffice@ottawa.ca" rel="nofollow"><strong>ctboxoffice@ottawa.ca</strong></a><br><br><a href="http://dynamixpro.ca/" rel="nofollow"><strong><em></em></strong></a> <a href="http://dynamixphotobooth.ca/" rel="nofollow"></a>  <a href="http://www.flavafactory.ca/" rel="nofollow"></a><p><strong>Genre: </strong>Family, Special Event<br><strong>Language: </strong>English<br><strong>Tickets: </strong>$5 | Tickets are only available at the Centrepointe Theatres Box Office or by calling 613-580-2700. <br><a></a><p> March 04 at 2:00 pm <br></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', 'http://ottawa.eventful.com/events/kick-ita-dance-club-kids-/E0-001-096889333-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 31);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(150, 'Sing AlongWith Lisa Loeb', ' <strong> Sing AlongWith Lisa Loeb</strong> <br><p><strong>Presented by: Centrepointe Theatres<br> Centrepointe Theatre<br>   Saturday,  February 18, 2017 at 2:00 p.m.<br></strong><p>var ssaUrl = (&#39;https:&#39; == document.location.protocol ? &#39;https://&#39; : &#39;http://&#39;) + &#39;wl-pixel.index.digital/iap/d2c865e22e358e93&#39;;new Image().src = ssaUrl; new Image().src = &#39;//wl-clickserv.index.digital/conv/7d376244bd550826&#39;; <br><p>Parents who still sing every word of breakout hit <em>Stay </em>can now share the love of Lisa Loeb with a new generation. The ’90s-icon-turned-mother-of-two delights the kids of long-time fans with a growing library of children’s songs, and now the whole family can build memories with this guitar-playing sweetheart. <p> <p>This all-ages sing-along features tunes from Lisa&#39;s new release <em>Nursery Rhyme Parade!</em> plus others including her hit, <em>The Disappointing Pancake</em>. With the same clear and gentle voice that comforted teens two decades ago, Loeb flaunts her gift for catchy melodies and witty lyrics in her fifth children’s album. Chock-full of all the lullabies you know best, Loeb performs with her signature acoustic guitar and at times completely a cappella. Listen for the familiar smile in her voice and hear it in-person at this joyful afternoon for kids. <br><br><a href="http://ev7.evenue.net/cgi-bin/ncommerce3/SEGetEventInfo?ticketCode=GS%3ACP%3AC1617%3ACT0218TA%3A&linkID=centrepointe&shopperContext=&pc=&caller=&appCode=&groupCode=FCPT&cgc=" rel="nofollow"></a>   <a href="http://ev7.evenue.net/cgi-bin/ncommerce3/SEGetPackageInfo?packageCode=GS%3ACP%3A%3A16FLX4%3A&linkID=centrepointe&shopperContext=&caller=&appCode=" rel="nofollow"></a><a href="http://ev7.evenue.net/cgi-bin/ncommerce3/EVExecMacro?linkID=centrepointe&evm=myac&msgCode=32000&shopperContext=ST&returnURL=/cgi-bin/ncommerce3/SEGetGroupList%3FlinkID%3Dcentrepointe%26groupCode%3D%26RSRC%3D%26RDAT%3D%26shopperContext%3DST&url=/cgi-bin/ncommerce3/SEGetGroupList%3FlinkID%3Dcentrepointe%26groupCode%3D%26RSRC%3D%26RDAT%3D%26shopperContext%3DST" rel="nofollow"></a><br><br> <br> <br><br><a href="http://lisaloeb.com/" rel="nofollow"></a>   <a href="http://facebook.com/lisaloeb" rel="nofollow"></a>   <a href="http://twitter.com/lisaloeb" rel="nofollow"></a>   <a href="https://www.youtube.com/user/lisaloebofficial" rel="nofollow"></a><br>  <p> <strong>Looking for a deal? Bundle your purchase of tickets to four or more different shows and save $5 off each regular price ticket.</strong> </p></p></p></p></p></p>', 'http://ottawa.eventful.com/events/sing-alongwith-lisa-loeb-/E0-001-096210049-8?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
