(170, 'Mayhem', ' with Inquisition, Black Anvil<br> Mayhem are a Norwegian black metal band formed in 1984 in Oslo long regarded as one of the pioneers of the Norwegian black metal scene. Mayhem&#39;s career has been highly controversial, primarily due to their violent stage performances, the 1991 suicide of vocalist Per Yngve Ohlin (&quot;Dead&quot;) and 1993 murder of guitarist ystein Aarseth (&quot;Euronymous&quot;) by former member Varg Vikernes (&quot;Count Grishnackh&quot;), also of Burzum.The group released a demo and an EP that were highly influential, and amassed a loyal following through sporadic and notorious live performances, attracting further attention through their ties to the string of Norwegian church burnings and the prominent incidents of violence surrounding them. They disbanded after Aarseth&#39;s murder, shortly before the release of their debut album, De Mysteriis Dom Sathanas, regarded as a classic of the black metal genre. Surviving former members Jan Axel Blomberg (&quot;Hellhammer&quot;), Jrn Stubberud (&quot;Necrobutcher&quot;) and Sven Erik Kristiansen (&quot;Maniac&quot;) reformed two years later with Rune Eriksen (&quot;Blasphemer&quot;) replacing Aarseth. Attila Csihar since replaced Kristiansen.The band&#39;s music strongly influenced the black metal genre and was instrumental in moving the wider metal scene away from the prevailing trend for speed metal. Their post-Aarseth material is characterised by increased experimentation. Mayhem&#39;s most recent album, Ordo Ad Chao, received the Spellemannprisen award for Best Metal Album in 2007.', 'http://edmonton.eventful.com/events/mayhem-/E0-001-097321611-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
