(177, 'The Weepies', ' <br> Singer-songwriters Deb Talan & Steve Tannen began writing together the night they met, and soon formed indie band The Weepies. On the strength of their simple yet insightful songwriting and distinctive harmonies, they quietly sold more than a million records, with over 17 million streams on Spotify, and 20 million views on YouTube. They married and had three children, rarely touring but continuing to release their music, five records over seven years.Just before Christmas 2013, when their youngest son was 17 months old, Deb Talan was diagnosed with Stage 3 breast cancer. She was in chemo by New Year&#39;s Eve.In 2014, Deb beat cancer, and The Weepies recorded the best album of their career. Coming back from the edge sharpened their skills and focus. At 16 songs and almost an hour long, SIRENS shows a band at the height of its powers.The couple was unable to travel while Deb was in treatment, so they worked at home, inviting guest musicians to record remotely wherever each musician happened to be, resulting in an unlikely superstar backing band. Players from across the spectrum jumped in, including: Pete Thomas and Steve Nieve (Elvis Costello), Gerry Leonard (David Bowie), Rami Jaffee (Foo Fighters), Tony Levin (Peter Gabriel), Oliver Kraus (Sia) and Matt Chamberlain (Pearl Jam), as well as veteran Weepies compatriots Frank Lenz, Eli Thomson, Jon Flaugher, Meg Toohey, and Whynot Jansveld, plus a horn section from New Orleans.The prophetic &quot;No Trouble&quot; was written prior to learning Deb&#39;s diagnosis. &quot;I don&#39;t need no trouble, but sometimes trouble needs me,&quot; sings Steve; Deb&#39;s vocals were recorded during her first weeks of chemo. The couple continued to write and record throughout treatment, with Deb providing several key vocals far into the year, including title track &quot;Sirens,&quot; captured in one take on a day where Deb really only had one take in her; her vulnerability is tangible. &quot;We just kept going,&quot; says Deb. &quot;We also have 3 small children, and were homeschooling, and the effects of chemo blew whole days out of the water.&quot;The band was able to use their limited studio time as an escape, leading to some of their most joyful tracks ever, including the genre-bending &quot;Fancy Things&quot; and the upbeat &quot;Early Morning Riser,&quot; aided mightily by a fantastic rhythm section and horns. There&#39;s plenty of heart and comfort for long time Weepies fans too the deceptively simple &quot;My Little Love,&quot; the gorgeous &quot;Brand New Pair of Wings&quot; and the straight ahead poetry of &quot;River From the Sky.&quot;After The Weepies had officially finished the album, and Deb was in recovery, they continued to record remotely with their phenomenal backing musicians for fun, eventuallyadding a cover of Tom Petty&#39;s &quot;Learning to Fly&quot; and a version of Irish balladeer Mark Geary&#39;s &quot;Volunteer&quot; to the final album.&quot;No one song could capture that year,&quot; says Steve. &quot;16 seems like a lot to release at once, but each song reflects a different angle of that long, suspended moment. They hang together like a bunch of photographs from a certain time. It was intense, but there was beauty and inspiration, too. Deb made it back. And we&#39;re still here.&quot;SIRENS will be released by Nettwerk worldwide on April 28, 2015.', 'http://toronto.eventful.com/events/weepies-/E0-001-096645531-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
