(219, 'Sing-a-long-a Sound of Music', ' This is your chance to sing-a-long to the most successful movie musical of all time. Sing-a-long-a-Sound of Music is not just a chance to see the classic movie on the big screen in magnificent technicolour and glorious cinemascope; it&#39;s a major audience participation event with subtitles for the songs. Singalong with Julie! Wave your Edelweiss! Dance in the gazebo with Liesl! Bark at Rolf! Snuggle up with Gretel and join in earnest choruses of <i>My Favorite Things</i>! <br><br><b>12:30 pm (Pre Show)</b> - Host leads audience through warmup and gives a comprehensive guide to the show. Each audience member will receive an interactive funpack. To add to the fun, come dressed up as anything and everything represented in the classic film -- the possibilities are as endless <br><br><b>1:00 pm</b>- Show begins <br><br><b>Running time</b>: 3 hours 50 minutes including pre show & interval <br><a></a>', 'http://edmonton.eventful.com/events/singalonga-sound-music-/E0-001-097423099-6?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
