(236, 'Valérie Lahaie et Philippe Berghella', ' <p>He seems to come straight out of a tale. Don Juan when he&#39;s in the mood, or else Soliman, the sultan from One Thousand and One Nights. She is rather solitary, spending her days at the piano, which she has studied since early childhood. <p>Valérie Lahaie and Philippe Berghella first met with millions of TV viewers watching on the popular program La Voix in 2014. Their friendship has led them to share today their musical worlds in the same show. <p>They present an evening filled with songs (Johnny Cash, Journey, Coldplay, Elvis, Kings of Keon and others) and discoveries from their respective albums. An intimate evening filled with joy and laughter!</p></p></p>', 'http://ottawa.eventful.com/events/valrie-lahaie-et-philippe-berghella-/E0-001-097252822-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
