(247, 'Araxi Restaurant: Intimate Wine Dinner - Chateau Ste Michelle, Washington', ' We are excited to welcome our close neighbours to the south as they serve a special lineup of Washington wines including those from the Eroica, Indian Wells, Ethos, and Artist Series lines. These are exceptional wines deserving of a special place at the table together with Araxi’s Pacific Northwest cuisine.<br><br><br>        <br><br><br><a href="http://thecellarbyaraxi.com/" title="Go to http://thecellarbyaraxi.com" rel="nofollow">thecellarbyaraxi.com</a><br><a href="https://twitter.com/araxirestaurant" title="Go to https://twitter.com/araxirestaurant" rel="nofollow">https://twitter.com/araxirestaurant</a><br><a href="https://www.instagram.com/araxirestaurant/" title="Go to https://www.instagram.com/araxirestaurant/" rel="nofollow">www.instagram.com/araxirestaurant</a><br><a href="https://www.facebook.com/AraxiRestaurant" title="Go to https://www.facebook.com/AraxiRestaurant" rel="nofollow">www.facebook.com/AraxiRestaurant</a><br><br><br>', 'http://eventful.com/events/araxi-restaurant-intimate-wine-dinner-chateau-ste-michelle-/E0-001-096744305-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 39);
